/* Drop table [ExchangeOrders] */
DROP TABLE IF EXISTS [main].[ExchangeOrders];

/* Table structure [ExchangeOrders] */
CREATE TABLE [main].[ExchangeOrders](
  [id] INTEGER PRIMARY KEY AUTOINCREMENT, 
  [datetime] DATETIME NOT NULL ON CONFLICT REPLACE DEFAULT (DATETIME ('now')), 
  [direction] TEXT, 
  [pair] INTEGER REFERENCES [TradingPairs]([id]) ON DELETE CASCADE, 
  [price] INTEGER, 
  [amount] INTEGER, 
  [remaining] INTEGER, 
  [status] TEXT NOT NULL ON CONFLICT REPLACE DEFAULT 'Open', 
  [Active] BOOL NOT NULL ON CONFLICT REPLACE DEFAULT True, 
  [UserID] INTEGER REFERENCES [Users]([UserID]) ON DELETE CASCADE);

/* Drop table [FilledOrders] */
DROP TABLE IF EXISTS [main].[FilledOrders];

/* Table structure [FilledOrders] */
