/* Drop view [1-ViewUnrepliedTickets] */
DROP VIEW IF EXISTS [main].[1-ViewUnrepliedTickets];

/* View structure [1-ViewUnrepliedTickets] */
CREATE VIEW [main].[1-ViewUnrepliedTickets]
AS
SELECT *
FROM   [UsersTicketsMessages]
WHERE  [Replied] = FALSE AND [UserID] != 1;

/* Drop view [2-ViewActiveTicketsForUser] */
DROP VIEW IF EXISTS [main].[2-ViewActiveTicketsForUser];

/* View structure [2-ViewActiveTicketsForUser] */
CREATE VIEW [main].[2-ViewActiveTicketsForUser]
AS
SELECT 
       *, 
       (SELECT COUNT (*)
       FROM   [UsersTicketsMessages]
       WHERE  [TicketID] = [UsersTickets].[id]) AS [messages]
FROM   [UsersTickets]
WHERE  [Active] IS TRUE
         AND [UsersTickets].[ToUserID] = (SELECT [id]
       FROM   [Users]
       WHERE  [Users].[username] = 'admin');

/* Drop view [3-GetMaxIDFromBalanceHistory] */
DROP VIEW IF EXISTS [main].[3-GetMaxIDFromBalanceHistory];

/* View structure [3-GetMaxIDFromBalanceHistory] */
CREATE VIEW [main].[3-GetMaxIDFromBalanceHistory]
AS
SELECT MAX ([id]) AS 'max(id)'
FROM   [UsersCurrenciesBalancesHistory];

/* Drop view [4-ViewBalancesHistory] */
DROP VIEW IF EXISTS [main].[4-ViewBalancesHistory];

/* View structure [4-ViewBalancesHistory] */
CREATE VIEW [main].[4-ViewBalancesHistory]
AS
SELECT 
       [UsersCurrenciesBalancesHistory].[id], 
       [UsersCurrenciesBalancesHistory].[DateTime], 
       [UsersCurrenciesBalancesHistory].[BalanceID], 
       [UsersBalancesTypes].[BalanceType], 
       [UsersCurrenciesBalancesHistory].[Amount], 
       [UsersCurrenciesBalancesHistory].[BalanceWas], 
       [UsersCurrenciesBalancesHistory].[BalanceAfter], 
       [UsersCurrenciesBalancesHistory].[Description]
FROM   [UsersCurrenciesBalancesHistory]
       INNER JOIN [UsersCurrenciesAccountBalances] ON [UsersCurrenciesAccountBalances].[BalanceID] = [UsersCurrenciesBalancesHistory].[BalanceID]
       INNER JOIN [UsersBalancesTypes] ON [UsersBalancesTypes].[TypeID] = [UsersCurrenciesAccountBalances].[BalanceTypeID];

/* Drop view [5-ViewBalancesTransfers] */
DROP VIEW IF EXISTS [main].[5-ViewBalancesTransfers];

/* View structure [5-ViewBalancesTransfers] */
CREATE VIEW [main].[5-ViewBalancesTransfers]
AS
SELECT 
       [UsersBalancesTransfers].[id], 
       [FromBalance].[BalanceID] AS [src], 
       [ToBalance].[BalanceID] AS [dest], 
       [UsersBalancesTransfers].[Amount], 
       [UsersBalancesTransfers].[TransferReason]
FROM   [UsersBalancesTransfers]
       JOIN [UsersCurrenciesAccountBalances] AS [FromBalance] ON [FromBalance].[BalanceID] = [UsersBalancesTransfers].[FromBalance]
       JOIN [UsersCurrenciesAccountBalances] AS [ToBalance] ON [ToBalance].[BalanceID] = [UsersBalancesTransfers].[ToBalance];

/* Drop view [6-ViewOperationsHistory] */
DROP VIEW IF EXISTS [main].[6-ViewOperationsHistory];

/* View structure [6-ViewOperationsHistory] */
CREATE VIEW [main].[6-ViewOperationsHistory]
AS
SELECT 
       [UsersCurrenciesBalancesHistory].[id], 
       [UsersCurrenciesBalancesHistory].[DateTime], 
       [UsersCurrenciesBalancesHistory].[BalanceID], 
       [UsersCurrenciesAccountBalances].[BalanceTypeID], 
       [UsersCurrenciesBalancesHistory].[Amount], 
       [UsersCurrenciesBalancesHistory].[BalanceWas], 
       [UsersCurrenciesBalancesHistory].[BalanceAfter], 
       [UsersCurrenciesBalancesHistory].[Description], 
       [UsersBalancesTransfers].[TransferReason]
FROM   [UsersCurrenciesOperationsHistory]
       INNER JOIN [UsersCurrenciesBalancesHistory] ON [UsersCurrenciesBalancesHistory].[id] = [UsersCurrenciesOperationsHistory].[HistoryID]
       INNER JOIN [UsersBalancesTransfers] ON [UsersBalancesTransfers].[id] = [UsersCurrenciesOperationsHistory].[ReasonID]
       INNER JOIN [UsersCurrenciesAccountBalances] ON [UsersCurrenciesAccountBalances].[BalanceID] = [UsersCurrenciesBalancesHistory].[BalanceID];

/* Drop view [7-ViewActiveOrders] */
DROP VIEW IF EXISTS [main].[7-ViewActiveOrders];

/* View structure [7-ViewActiveOrders] */
CREATE VIEW [main].[7-ViewActiveOrders]
AS
SELECT *
FROM   [ExchangeOrders]
WHERE  [Active] IS TRUE;

