/* Table triggers [ExchangeOrders] */
CREATE TRIGGER [main].[PartiallyFillOrder] AFTER UPDATE ON [ExchangeOrders] FOR EACH ROW WHEN [new].[remaining] != 0
                                                                                                AND [new].[remaining] < [old].[remaining]
BEGIN
  INSERT INTO [OrdersHistory]
    (
    [OrderID], 
    [Action], 
    [price], 
    [Amount], 
    [Description])
    VALUES ([new].[id], 'Fill', [new].[price], [old].[remaining] - [new].[remaining], 'Fill partially, and leave opened');
  UPDATE
    [ExchangeOrders]
  SET
    [status] = 'Partially filled', 
    [Active] = TRUE
  WHERE
    [id] = [new].[id];
END;
CREATE TRIGGER [main].[CancelOrder] AFTER UPDATE ON [ExchangeOrders] FOR EACH ROW WHEN [new].[Active] IS FALSE AND [new].[status] != 'Fullfilled'
BEGIN
  INSERT INTO [OrdersHistory]
    (
    [OrderID], 
    [Action], 
    [price], 
    [amount], 
    [Description])
    VALUES ([new].[id], 'Cancel', [new].[price], [new].[remaining], 'Cancel order');
  UPDATE
    [ExchangeOrders]
  SET
    [status] = 'Cancelled'
  WHERE
    [id] = [new].[id];
END;
CREATE TRIGGER [main].[FullfillOrder] AFTER UPDATE ON [ExchangeOrders] FOR EACH ROW WHEN ([new].[remaining] = 0 OR [new].[status] = 'Fullfilled')
BEGIN
  INSERT INTO [OrdersHistory]
    (
    [OrderID], 
    [Action], 
    [price], 
    [Amount], 
    [Description])
    VALUES ([new].[id], 'Fullfill', [new].[price], [old].[remaining], 'Fullfill and close order');
  UPDATE
    [ExchangeOrders]
  SET
    [Remaining] = 0, 
    [status] = 'Fullfilled', 
    [Active] = FALSE
  WHERE
    [id] = [new].[id];
END;
CREATE TRIGGER [main].[OpenOrder] AFTER INSERT ON [ExchangeOrders] FOR EACH ROW WHEN [new].[Active] IS TRUE
BEGIN
  INSERT INTO [OrdersHistory]
    (
    [OrderID], 
    [Action], 
    [price], 
    [Amount], 
    [Description])
    VALUES ([new].[id], 'Open', [new].[price], [new].[Amount], 'Open order');
  UPDATE
    [ExchangeOrders]
  SET
    [Status] = 'Open', 
    [remaining] = [new].[Amount]
  WHERE
    [id] = [new].[id];
END;
CREATE TRIGGER [main].[ReOpenOrder] AFTER UPDATE ON [ExchangeOrders] FOR EACH ROW WHEN [new].[Active] IS TRUE
                                                                                         AND [new].[remaining] == [old].[amount]
BEGIN
  INSERT INTO [OrdersHistory]
    (
    [OrderID], 
    [Action], 
    [price], 
    [amount], 
    [Description])
    VALUES ([new].[id], 'Open', [new].[price], [new].[amount], 'Open order');
  UPDATE
    [ExchangeOrders]
  SET
    [Status] = 'Open'
  WHERE
    [id] = [new].[id];
END;

/* Table triggers [FilledOrders] */
CREATE TRIGGER [main].[FillOrders] AFTER INSERT ON [FilledOrders] FOR EACH ROW
BEGIN
  UPDATE
    [ExchangeOrders]
  SET
    [remaining] = [remaining] - [new].[amount]
  WHERE
    [id] IN ([new].[BuyID], [new].[SellID]);
END;

/* Table triggers [UsersCurrenciesAccountBalances] */
CREATE TRIGGER [main].[AddBalanceHistoryOnChangeBalance] AFTER UPDATE OF [Balance] ON [UsersCurrenciesAccountBalances] FOR EACH ROW WHEN ((SELECT [BalanceAfter]
                                                                                                                                         FROM   [UsersCurrenciesBalancesHistory]
                                                                                                                                         WHERE  [id] = (SELECT MAX ([id])
                                                                                                                                                FROM   [UsersCurrenciesBalancesHistory]
                                                                                                                                                WHERE  [BalanceID] = [new].[BalanceID])) != [new].[Balance])
                                                                                                                                           OR NOT EXISTS (SELECT *
                                                                                                                                         FROM   [UsersCurrenciesBalancesHistory]
                                                                                                                                         WHERE  [BalanceID] = [new].[BalanceID])
BEGIN
  INSERT INTO [UsersCurrenciesBalancesHistory]
    (
    [BalanceID], 
    [Amount], 
    [BalanceWas], 
    [BalanceAfter], 
    [Description])
    VALUES ([old].[BalanceID], CAST ([new].[Balance] AS [INTEGER]) - CAST ([old].[Balance] AS [INTEGER]), [old].[Balance], [new].[Balance], NULL);
END;

/* Table triggers [UsersBalancesTransfers] */
CREATE TRIGGER [main].[UpdateBalances] AFTER INSERT ON [UsersBalancesTransfers] FOR EACH ROW
BEGIN
  UPDATE
    [UsersCurrenciesAccountBalances]
  SET
    [Balance] = [Balance] - [new].[Amount]
  WHERE
    [id] = [new].[FromBalance];
  UPDATE
    [UsersCurrenciesAccountBalances]
  SET
    [Balance] = [Balance] + [new].[Amount]
  WHERE
    [id] = [new].[ToBalance];
  INSERT INTO [UsersCurrenciesOperationsHistory]
    (
    [HistoryID], 
    [ReasonID])
    VALUES ((SELECT MAX ([id]) - 1
  FROM   [BalanceHistory]), [new].[id]), 
         ((SELECT MAX ([id])
  FROM   [BalanceHistory]), [new].[id]);
END;

/* Table triggers [UsersCurrenciesBalancesHistory] */
CREATE TRIGGER [main].[UpdateBalanceIfNeed] AFTER INSERT ON [UsersCurrenciesBalancesHistory] FOR EACH ROW WHEN (SELECT [Balance]
                                                                                                               FROM   [UsersCurrenciesAccountBalances]
                                                                                                               WHERE  [UsersCurrenciesAccountBalances].[BalanceID] = [new].[BalanceID]) != [new].[BalanceAfter]
BEGIN
  UPDATE
    [UsersCurrenciesAccountBalances]
  SET
    [Balance] = CAST ([new].[BalanceAfter] AS [INTEGER])
  WHERE
    [UsersCurrenciesAccountBalances].[BalanceID] = [new].[BalanceID];
END;

/* Table triggers [UsersCurrenciesOperationsHistory] */
CREATE TRIGGER [main].[UpdateDescription] AFTER INSERT ON [UsersCurrenciesOperationsHistory] FOR EACH ROW
BEGIN
  UPDATE
    [UsersCurrenciesBalancesHistory]
  SET
    [Description] = 'Reason is movement ID: ' || [new].[ReasonID]
  WHERE
    [id] = [new].[HistoryID];
END;

/* Table triggers [UsersTicketsMessages] */
CREATE TRIGGER [main].[MarkReplied] AFTER INSERT ON [UsersTicketsMessages] WHEN [new].[ReplyToId] IS NOT NULL
BEGIN
  UPDATE
    [UsersTicketsMessages]
  SET
    [Replied] = TRUE
  WHERE
    [id] = [new].[ReplyToId];
END;

/* Commit transaction */
COMMIT;

/* Enable foreign keys */
PRAGMA foreign_keys = 'on';
